    const rolladex = friendsList.map(function (individual) {
        return (
            <h1>
                <Friend name={individual.name} age={individual.age} pets={individual.pets} />

            </h1>
        )
    })


    return (
        <div>
            {rolladex}
        </div>
    )

}

export default App
